import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Wait for the wishlist link and click it
    await page.waitForSelector('a:has-text("Your Wish List")', { timeout: 5000 });
    await page.click('a:has-text("Your Wish List")');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_clicked.png'));

    // Wait for the add to wishlist button and click it
    await page.waitForSelector('.add-to-wishlist', { timeout: 5000 });
    await page.click('.add-to-wishlist');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_added_to_wishlist.png'));

    return {
      success: true,
      action: "Product added to wishlist",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
